import "./App.css";
import "./static/css/style.css";
import "./static/css/theme.css";

import Header from "./components/Header";
import Footer from "./components/Footer";



function App() {
  return (
    <div className="App">
      <Header />

      <div className="intro">
        <img
          className="home-img"
          src="./static/images/home.jpg"
          alt="Terrazas image"
        />
        <div className="text">
          Terrazas de Guacuco.
          <br />
          Welcome to the premier residntial complex in Venezuela
        </div>
      </div>

      <div className="extender"></div>

      <Footer />
    </div>
  );
}

export default App;
